import React from 'react'
import Flag from '../image/Ellipse 12.png';
import './Jewell.css';
import Divider from '../image/SwirlDivider.png';
function Jewell() {
  return (
    <div>
      <div className="jewell">
        <div className="jewellimage">
          <img className='djewellimg' src={Flag} alt="Did you know" />
        </div>
        <div className="jewellheader">
          <h1>Did You Know</h1>
          <img src={Divider} alt="Caption Divider" style={{ width: '150px', height: '25px', marginLeft: '0px', backgroundColor: 'transparent' }} />
         
          <button class=" jewellbtn" ><span>Read More </span></button>

        </div>

      </div>
      <hr/>
    </div>
  )
}

export default Jewell
